const inputs = [
    "",
    "",
    "",
    "",
    ""
];

const keyPad = [
    ["" , "" , "1", "" , ""],
    ["" , "2", "3", "4", ""],
    ["5", "6", "7", "8", "9"],
    ["" , "A", "B", "C", ""],
    ["" , "" , "D", "" , ""],
];

let currentRow = 1;
let currentCol = 1;
let prevValue = "";
let keyKode = "";
for (let input of inputs) {
    for(let step of input) {
        if (step === "U" && keyPad[currentRow - 1] && keyPad[currentRow - 1][currentCol]) {
            currentRow--;
        } else if (step === "R" && keyPad[currentRow] && keyPad[currentRow][currentCol + 1]) {
            currentCol++;
        } else if (step === "D" && keyPad[currentRow + 1] && keyPad[currentRow + 1][currentCol]) {
            currentRow++;
        } else if (step === "L" && keyPad[currentRow] && keyPad[currentRow][currentCol - 1]) {
            currentCol--;
        }
    }
    const currentValue = keyPad[currentRow][currentCol];
    console.log(currentValue);
}

console.log(`key code: ${keyKode}`);